import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import reportWebVitals from "./reportWebVitals";
import Notifications from "./Notifications";

const appRoot = document.getElementById("root");
const notificationsRoot = document.getElementById("root-notifications");

const appRootRoot = ReactDOM.createRoot(appRoot);
appRootRoot.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

const notificationsRootRoot = ReactDOM.createRoot(notificationsRoot);
notificationsRootRoot.render(
  <React.StrictMode>
    <Notifications />
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
